import { Component } from '@angular/core';
import { HomeComponent } from './home/home.component';

@Component({
  selector: 'app-root',
  standalone: true,
  imports: [
    HomeComponent,
  ],
  template: `
  <main>
    <header class="brand-name">
      <img class="brand-logo" src="../assets/logo.svg">
    </header>
  </main>`,
  styleUrls: ['/'],
})
export class AppComponent {
  title = 'homes';
}


